import axios from "axios";
import appConfig from "../Utils/Config";

class DataService {
  async sendAndReceiveInitialPrompt<T, U>(
    endpoint: string,
    data: T
  ): Promise<U> {
    try {
      console.log(endpoint);
      console.log(data);

      const jsonData = { input: data };
      const response = await fetch(`${appConfig.serverUrl}/${endpoint}`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(jsonData),
      });
      console.log(JSON.stringify(jsonData));

      if (!response.ok) {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }

      return await response.json();
    } catch (error) {
      console.error("Fetch error:", error);
      throw error;
    }
  }

  async askForMissingValues<T, U>(endpoint: string, data: T): Promise<U> {
    try {
        const apiUrl = 'http://example.com/api/endpoint';
    
        const queryParams = {
          param1: 'value1',
          param2: 'value2',
        };
    
        const response = await axios.post(apiUrl, null, { params: queryParams });
    
        if (response.status === 200) {
          console.log('POST request with query parameters was successful');
          console.log(response.data);
        } else {
          console.error(`HTTP error! Status: ${response.status}`);
        }
        return await response;
      } catch (error) {
        console.error('Error:', error);
      }
    // try {
    //   const response = await fetch(`${appConfig.serverUrl}/${endpoint}`, {
    //     method: "POST",
    //     headers: {
    //       "Content-Type": "application/json",
    //     },
